#include <iostream>
#include <vector>
#include <unordered_map>
#include <queue>

using namespace std;

class Solution {
public:
    int minJumps(vector<int>& arr) {
        int n = arr.size();
        unordered_map<int,vector<int>> m;
        for (int i = 0; i < n; i++){
            m[arr[i]].push_back(i);
        }

        int round = 0;
        vector<bool> visited(n, false);
        queue<int> que;
        que.push(0);
        visited[0] = true;
        
        while(!visited[n-1]){
            int s = que.size();
            while(s--){
                int node = que.front();
                que.pop();
                if (node == n-1) return round;
                for (auto i : m[arr[node]]){
                    if (!visited[i]) que.push(i), visited[i] = true;
                }
                m[arr[node]].clear();
                if (node-1 >= 0 && !visited[node-1]) que.push(node-1), visited[node-1] = true;
                if (node+1 < n && !visited[node+1]) que.push(node+1), visited[node+1] = true;
            }
            round++;
        }
        return round;
    }
};

